using Microsoft.AspNetCore.Mvc;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using UserService.Controllers;
using UserService.DBContext;
using UserService.Models;
using UserServiceXUnitTest.Fixture;

namespace UserServiceXUnitTest
{
    public class FileUploadControllerTest : IClassFixture<FileUploadControllerFixture>
    {
        FileUploadController fileUploadController;

        /**
         * xUnit constructor runs before each test. 
         */
        public FileUploadControllerTest(FileUploadControllerFixture fixture)
        {
            fileUploadController = fixture.fileUploadController;
        }
        [Fact]
        public void GetFileUploadLog_WithTestData_ThenOk_Test()
        {
            var result = fileUploadController.GetFileUploadLog();

            Assert.IsType<List<UploadFileLog>>(result);
        }
        [Fact]
        public void FileUpload_WithValidData_ThenOk_Test()
        {
            FileUploadModel obj = new FileUploadModel();
            obj.FileName = "ABC.xlsx";
            obj.strFile = "data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,";

            IActionResult response = fileUploadController.FileUpload(obj);

            // Assert
            OkResult objectResponse = Assert.IsType<OkResult>(response);

            Assert.Equal(200, objectResponse.StatusCode);
        }
        [Fact]
        public void FileUpload_WithInvalidData_ThenBadRequest_Test()
        {
            FileUploadModel obj = new FileUploadModel();
            obj.FileName = "ABC.xlsx";
            //obj.strFile = "data:application/vnd.openxmlformats-officedocument.spreadsheetml.sheet;base64,";
            obj.strFile = "";

            IActionResult response = fileUploadController.FileUpload(obj);

            // Assert
            BadRequestResult objectResponse = Assert.IsType<BadRequestResult>(response);

            Assert.Equal(400, objectResponse.StatusCode);
        }

    }
}
